pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract CreateParty is Ownable {
    using SafeMath for uint256;

    uint256 public feeDivisor = 10000;
    uint256 public devFee = 2500;
    uint256 public liquidityFee = 7500;

    address public devWallet = address(0xC32EE58C13B4346227F6D10e4307541d13df81d7);
    address public liquidityWallet = address(0xEeeAd7f13da21164C7eEBce08D6f436318E06A80);

    uint256 private _priceInitial = 12000000000000000000;
    uint256 private _pricePerToken = 5000000000000000000;

    IERC20 public token;
    address public tokenAddress = address(0x670568763731F1cd604c7611907878F1B4956B4d);

    constructor() {
        IERC20 _token = IERC20(tokenAddress);
        token = _token;
    }

    function getInitialPrice() public view returns (uint256) {
        return _priceInitial;
    }

    function setInitialPrice(uint256 _newPrice) external onlyOwner {
        _priceInitial = _newPrice;
    }

    function getAdditionalPrice() public view returns (uint256) {
        return _pricePerToken;
    }

    function setAdditionalPrice(uint256 _newPrice) external onlyOwner {
        _pricePerToken = _newPrice;
    }

    function transferToken(uint256 tokenAmount) public returns (bool) {
        uint256 devFeePrice = tokenAmount * devFee / feeDivisor;
        uint256 liquidityFeePrice = tokenAmount * liquidityFee / feeDivisor;

        if(devWallet != address(0) && devFeePrice > 0) {
            token.approve(devWallet, devFeePrice);
            token.transferFrom(msg.sender, devWallet, devFeePrice);
        }

        if(liquidityWallet != address(0) && liquidityFeePrice > 0) {
            token.approve(liquidityWallet, liquidityFeePrice);
            token.transferFrom(msg.sender, liquidityWallet, liquidityFeePrice);
        }
        
        return true;
    }

    function setDevWallet(address _addr) external onlyOwner {
        require(_addr != address(0), "Zero Address");
        devWallet = _addr;
    }

    function setLiquidityWallet(address _addr) external onlyOwner {
        require(_addr != address(0), "Zero Address");
        liquidityWallet = _addr;
    }

    function setDevFee(uint256 _newFee) external onlyOwner {
        require(_newFee <= 2500, "Tax can't be over 25%");
        devFee = _newFee;
    }

    function setLiquidityFee(uint256 _newFee) external onlyOwner {
        require(_newFee <= 7500, "Tax can't be over 75%");
        liquidityFee = _newFee;
    }
}
